import React, { Component } from 'react'
import ReactTable from 'react-table'
import api from '../api'

import styled from 'styled-components'

class ListaConsulta extends React.Component {

    constructor() {
      super();
      this.state = { consultas: null };
    }

    componentDidMount() {
      fetch('http://localhost:5000/enquiries', {
          method: 'GET',
      })
      .then(results => results.json())
      .then(data => this.setState({ consultas: data }))
      .catch(function(error) {console.log(error)});
    }

    _renderConsultas(consulta, index) {
      return <li key={index}>{consulta.fecha} - {consulta.motivo}</li>
    }

      render() {
      const { consultas } = this.state;

      return (
          <div>
          <h1>LIST OF CONSULTAS:</h1>
            <ul>
              {
              consultas ?
              consultas.map(this._renderConsultas)
              :
              "no data to display"
            }
            </ul>
          </div>
      );
    }
  }

export default ListaConsulta;
